const main = async () => {
  const errors = [];
  // for (const page of highPrioResPost92) {
  for (const page of ec3f) {
    // let mdTxt = await fetchText(`https://main--bacom--adobecom.hlx.page${page}.md`);

    let mdTxt = await fetchText(`${page}.md`);
    if (!mdTxt) {
      console.log('Error: ', page);
      errors.push(`No MD Text: ${page}`);
      continue;
    }
    const mdast = await getMdast(mdTxt);
    if (!mdast) continue;

    const cardMd = getTable(mdast, 'card metadata')[0];
    if (!cardMd) {
      console.log('Error: Card Metadata table not found:', page);
      continue;
    }

    const keyvals = getKeyVals(cardMd.table);

    const rawtags = getKeyVal(keyvals, 'tags');
    if (rawtags === undefined) {
      console.log('No Tags found: ', page);
      continue;
    }
    const tags = rawtags?.val?.value;

    if (!tags) {
      console.log('Tags Error:', page);
      continue;
    }

    let tagsUpdated = false;
    // convert tags to caas if available
    let updatedTags = tags.split(/,|(\s+)|(\\n)/g)
      .filter(Boolean)
      .map(tag => {
        const lcTag = tag.toLowerCase().trim();
        if (tag.startsWith('caas:')) {
          return lcTag;
        }
        if (tagMap[lcTag]) {
          tagsUpdated = true;
          return tagMap[lcTag];
        }
        return lcTag;
      });
    if (!tagsUpdated) {
      continue;
    }

    updatedTags = [...new Set(updatedTags)]; // remove duplicates

    updateKeyValue(keyvals, 'tags', updatedTags.join(','));
    const outputDir = 'output/' + page.substring(39, page.lastIndexOf('/'))
    await saveDocx(mdast, page.split('/').pop(), outputDir);
    console.log(`Saved ${page}`);
  }
};

await main();
process.exit(0);
